  return (
    <BrowserRouter>
            <Suspense >


              <Switch>


                <Route exact path="/"><Login  /></Route>
                <Route exact path="/dashboard"><Dashboard  /></Route>

              </Switch>


            </Suspense>

            {/* <ToastContainer enableMultiContainer containerId={'A'} position={toast.POSITION.BOTTOM_LEFT} /> */}
          </BrowserRouter>
  );
}

export default App;
